INSERT INTO products_product VALUES(43,'Double Pig','Our traditional Bratwurst piled with masses of home smoked crispy bacon.  Great with dollops of mustard, onions and rocket.',8,'Bacon loaded Bratwurst',1,'product_images/bratwurst-bacon.jpeg');
INSERT INTO products_product VALUES(45,'Smokey One','Multi-award winning and stupendously smoked! This is the one for you if you love full flavours and beautiful aromas.',7.5,'Seriously smoked',1,'product_images/bratwurst-special.jpeg');
INSERT INTO products_product VALUES(46,'Spring Onion','The traditional Bratwurst topped with fresh crisp spring onions. A top seller complimented perfectly by out homemade ketchup.',7,'Sprinkled with onions',1,'product_images/bratwurst-spring-onion.jpeg');
INSERT INTO products_product VALUES(47,'Chorizo Burger','Perhaps the perfect combination. The best burger you''ll ever find, complimented perfectly with chorizo.',7,'Beef n Pork',3,'product_images/burger-chorizo-egg.jpeg');
INSERT INTO products_product VALUES(48,'Double Cheese','Double trouble! Two of our wonderful burgers topped with award winning, locally produced cheddar cheese.',8,'Two burgers',3,'product_images/burger-double-cheese.jpeg');
INSERT INTO products_product VALUES(49,'Shroomy','Get Wurst''s amazing burger paired with perfectly seasoned locally picked mushrooms.',2,'With mushrooms',3,'product_images/burger-mushrooms.jpeg');
INSERT INTO products_product VALUES(50,'Seriously Salsa','This is for the flavour lovers! Topped with a seriously sweet, tangy and slightly spicy home made tomato and herb salsa.',3,'Tomato relish topped',3,'product_images/MJ_TERST_Y045uD3.png');
INSERT INTO products_product VALUES(52,'Fried Chicken','A selection of fried thigh and drumstick pieces. Coated in our award winning homemade batter.',5,'Fried and battered',2,'product_images/chicken-fried-pieces.jpeg');
INSERT INTO products_product VALUES(53,'BBQ Wings','The very best wings smothered in a rich tangy BBQ sauce. Very moreish!',33,'Coated in BBQ sauce',2,'product_images/chicken-wings-bbq.jpeg');
INSERT INTO products_product VALUES(54,'Honey Wings','Like it sweet? These are the wings for you. The perfect combo we all love.',4,'Sweet!',2,'product_images/chicken-wings-honey_Em9K2zv.jpeg');
INSERT INTO products_product VALUES(55,'Satay Wings','Perfectly peanuty satay sauce covered chicken wings. Our best selling wings, find out why.',4,'Peanut flavoured',2,'product_images/chicken-wings-satay.jpeg');
INSERT INTO products_product VALUES(56,'Hot Wings','Perfectly spiced chicken wings coated in handmade crispy batter.',4,'Slightly spiced wings',2,'product_images/chicken-wings-hot.jpeg');
